customCSS:
/* Change font color of Hero for mobile */
@media only screen and (max-width: 768px) {
  .forceCommunityThemeHeroBase .contentTitle {
      color: white !important;
  }
}

/* Removing frameborder on CMS video */
.forceCommunityBannerLayout iframe
{
    border: 0;
}

/* notifications icon -> cart icon */
.unsNotificationsCounter svg {
    display: none;
}
.unsNotificationsCounter {
    content: "";
    width: 24px;
    height: 24px;
    /*background: url('data:image/png;base64,') no-repeat left center;*/
    /*background: url('data:image/png;base64,') no-repeat left center;*/
    background: url('data:image/png;base64,') no-repeat left center;
    background-size: cover;
    display: inline-block;
}

/* Einstein NBA Styling */
.runtime_communities_nbaNbaWidget {
    text-align: center;
    border: 2px solid #f1f1f1 !important;
}
.test-propositionDescription {
    font-size: 1rem;
}
.runtime_communities_nbaNbaWidget .titleHeader .plainWidgetTitle {
    font-size: 1.5rem !important;
}
.runtime_communities_nbaNbaCard .nbaImage {
    height: 160px !important;
}
